# This program was used to find the best AIC model for overall mortality
# Models were fit to odd year NHIS surveys from 1997-2009

rm(list=ls(all=TRUE))

# Set up
library(survival)
library(survey)
load(file="~/Desktop/Lung cancer/lrisk/other/lifeyearsgained/nhis_imputed_1997_09_odd_1.RData")

nhis$deathage[nhis$deathage<=nhis$age] <- nhis$age[nhis$deathage<=nhis$age] + .125 #give some follow-up time to those whose deathage is <= current age
master  <- svydesign(id=~psu, strata=~strata, weights=~adj.wt_mort, data=nhis, nest=TRUE)
design <- subset(master, age>=40&age<=84 & analypop==1 & deathage>age)  #change to 40-84 year olds

# PART 1: LUNG CANCER DEATH RISK MODELS
modcall <- function(formula) {                         
  cox.mort <- svycoxph(formula, design = design, data = nhis, model = TRUE, y= TRUE)
  sum.mod <- data.frame(as.character(formula)[3],cox.mort$ll[2],2*length(coef(cox.mort)) - 2*cox.mort$ll[2],cox.mort$concordance[1]/(cox.mort$concordance[1]+cox.mort$concordance[2]),row.names=NULL,check.names=FALSE)
  return(sum.mod)
}

modsum <- data.frame()

#USE SAS TO WRITE THE CALLS
modsum <- rbind(modsum,modcall(Surv(age, deathage, died) ~ female+race+edu6+I(bmi <= 18.5)+I(bmi>18.5&bmi<=20)+I(bmi>25&bmi<=30)+I(bmi>30&bmi<=35)+I(bmi>35)+year+emp+hypertension+chd+angina+heartattack+heartdisease+stroke+diab+bron+kidney+liver+speceq+prior.cancer+qtyears+cpd+smkyears))
